import React from 'react';
import config from '../config/api';
// import { GoogleLogin } from 'react-google-login';
import settings_icon from '../../img/settings_icon.svg';
import { Button } from 'antd';

const AuthComponent = ({ handleSuccess, handleFailure, is_auth_attempt }) => {
  return(
    <div className="login-container">
      <div className="welcome-heading">
        <h1>INTERNAL WORKFLOW</h1>
      </div>
      <div className="login-wrapper">
        <div className="login-button-wrapper">
          <img className="login-img" src={settings_icon} alt=""/>
          {/* <GoogleLogin
            clientId={config.google_client_id}
            render={renderProps => (
              is_auth_attempt ? <div class="loader-16"></div> : <button className="login-button" onClick={renderProps.onClick} disabled={renderProps.disabled}>LOGIN</button>
            )}
            onSuccess={handleSuccess}
            onFailure={handleFailure}
          /> */}
          <Button className="ms-sign-in" id="SignIn" type="primary" onClick={() => handleSuccess()}>Login</Button>
        </div>
        <div className="teams">
          <h2 className="team-headings sales">SALES</h2>
          <h2 className="team-headings research">RESEARCH</h2>
          <h2 className="team-headings editing">EDITING</h2>
          <h2 className="team-headings formatting">FORMATTING</h2>
          <div className="lines first"></div>
          <div className="lines second"></div>
          <div className="lines third"></div>
          <div className="lines fourth"></div>
          <div className="lines fifth"></div>
          <div className="lines sixth"></div>
          <div className="dot"></div>
        </div>
      </div>
    </div>
  );
}

export default AuthComponent;
